import React, {useState, useEffect} from "react"
import Question from "./Question"

function Quiz() {
    const [questions, setQuestions] = useState()


    const elems =  [...Array(5).keys()].map(elem => <Question key={elem} id={elem} /> )
    return (
       <div className="quiz">
            {elems}
            <button className="blue-button">New Questions</button>
       </div>
    )
}

export default Quiz
